import React from 'react';
import './Search.css';
import axios from 'axios';
import { Card,ListGroup,ListGroupItem } from 'react-bootstrap';

class Search extends  React.Component {

	constructor( props ) {
		super( props );

		this.state = {
			query: '',
                        results: {},
                        loading: false,
                        message: '',
		};
	}

	fetchSearchResults = (updatedPageNo = '', query ) => {

		// const pageNumber = updatedPageNo ? `&page=${updatedPageNo}` : '';

		// By default the limit of results is 20
		const searchUrl = `https://nutritionix-api.p.rapidapi.com/v1_1/search/${query}`;
		const options = {
		  method: 'GET',
		  url: searchUrl,
		  params: {fields: 'item_name,item_id,brand_name,nf_calories,nf_total_fat'},
		  headers: {
		    'x-rapidapi-key': '518dacdf68mshe074609f26cc4e9p107185jsn84ce96ca1395',
		    'x-rapidapi-host': 'nutritionix-api.p.rapidapi.com'
		  }
		};

		if (this.cancel) {
			// Cancel the previous request before making a new request
			this.cancel.cancel();
		}
		// Create a new CancelToken
		this.cancel = axios.CancelToken.source();

		axios.request(options, {
				cancelToken: this.cancel.token,
			})
			.then((res) => {
				const resultNotFoundMsg = !res.data.hits.length
					? 'There are no more search results. Please try a new search.'
					: '';

				this.setState({
					results: res.data.hits,
					message: resultNotFoundMsg,
					loading: false,
				});
			})

			.catch((error) => {
				if (axios.isCancel(error) || error) {
					this.setState({
						loading: false,
						message: 'Failed to fetch results.Please check network',
					});
				}
			});
	};

	handleOnInputChange = (event) => {
		const query = event.target.value;

		if ( ! query ) {
			this.setState({ query, results: {}, message: '' } );
		} else {
			this.setState({ query, loading: true, message: '' }, () => {
				this.fetchSearchResults(1, query);
			});
		}
		console.log(this.state.results)
	};


	renderSearchResults = () => {
		const {results} = this.state;

		if (Object.keys(results).length && results.length) {
			return (
					<div>
					{results.map((result,i) => {
						return (
							<div className="col-12" key={result._id}>
								<div className="card card-custom">
									<div className="card-body">
										<h5 className="card-title">{results[i].fields.item_name}</h5>
									</div>
									<ul className="list-group list-group-flush">
										<li className="list-group-item">
											<svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 128 128"><defs></defs><title>Done</title><g id="Done"><path class="cls-1" d="M85.17,46.61l4.22,4.22L56,84.21,38.61,66.83l4.22-4.22L55.28,75.06a1,1,0,0,0,1.44,0Z"/><path class="cls-1" d="M64,19a45,45,0,1,0,45,45A45,45,0,0,0,64,19ZM91.55,51.55C54.39,88.71,56.65,86.68,56,86.68s1,1.37-19.55-19.13a1,1,0,0,1,0-1.44l5.66-5.66a1.05,1.05,0,0,1,1.44,0L56,72.9,84.45,44.45a1.05,1.05,0,0,1,1.44,0l5.66,5.66A1,1,0,0,1,91.55,51.55Z"/><path class="cls-1" d="M127,64c0-5.44-5.14-10.13-6.48-15.15-1.39-5.19.68-11.81-2-16.36s-9.46-6.11-13.2-9.86-5.25-10.53-9.86-13.2S84.34,8.87,79.15,7.48C74.13,6.14,69.44,1,64,1S53.87,6.14,48.85,7.48C43.66,8.87,37,6.8,32.49,9.43s-6.11,9.46-9.86,13.2S12.1,27.88,9.43,32.49,8.87,43.66,7.48,48.85C6.14,53.87,1,58.56,1,64S6.14,74.13,7.48,79.15C8.87,84.34,6.8,91,9.43,95.51s9.46,6.11,13.2,9.86,5.25,10.53,9.86,13.2,11.17.56,16.36,2c5,1.34,9.71,6.48,15.15,6.48s10.13-5.14,15.15-6.48c5.19-1.39,11.81.68,16.36-2s6.11-9.46,9.86-13.2,10.53-5.25,13.2-9.86.56-11.17,2-16.36C121.86,74.13,127,69.44,127,64ZM64,111a47,47,0,1,1,47-47A47.07,47.07,0,0,1,64,111Z"/></g></svg>

										</li>
										<li className="list-group-item">Dapibus ac facilisis in</li>
										<li className="list-group-item">Vestibulum at eros</li>
									</ul>
								</div>
							</div>
							);
						})}
				</div>


			);
		}
	};

	render() {
		const {query} = this.state.query;
		return (
			<div className="container">
				{/*Heading*/}
					<div className="row">
						<div className="col-12 bagian-atas">
							<h2>Cari Makanan</h2>
						</div>
						<div className="col-12">
								<input
								 className="form-control me-2 search-custom"
								 type="text"
								 name="query"
								 value={query}
								 placeholder="Search..."
								 onChange={this.handleOnInputChange}
								/>
						</div>

					{this.renderSearchResults()}
					</div>
			</div>
			)
	}
}

export default Search;
